function: "Outdated design, i recommend the Nano Extruder instead http://www.thingiverse.com/thing:27577 \r\n\r\nAs i got a PG35L extruder into my hands i need an extruder to fit on my Orca.\r\n\r\nSo i decided to make another mashup from the already available PG35L Micro Extruder my Universal-Wade and is again optimized to work with uniX-Carriage \r\nfor Orca http://www.thingiverse.com/thing:25420\r\nor Prusa http://www.thingiverse.com/thing:25600\r\n\r\nThis extruder should fit on any Printer with 50mm mounting holes \r\n\r\n* 1,75mm and 3mm Filament Support (1,75 with brass inset)\r\n\r\n* compatible with J-Head/Groovemount/Reprapfab/Geeksbase/Mendelparts V9/v10 and probably alot of other hotends\r\n\r\n* lots of small improvements ;)"
